import React from 'react';
import '../App.css';
import Map from './Map'; // Importovanje komponente sa mapom
import NavigacioniBar from './NavigacioniBar';
function AboutUs() {
  // Tekst o vašem fitness centru
  const aboutText = "Dobrodošli u naš fitness centar! Naš cilj je da vam pružimo vrhunski fitness doživljaj i pomoć u postizanju vaših ciljeva. Sa stručnim trenerima i raznovrsnim programima vežbanja, nudimo vam sve što je potrebno za zdrav i aktivan život.";

  return (
    <div className="about-container">
            <NavigacioniBar/>

      <div className="about-text">
        <h2>O nama</h2>
        <p>{aboutText}</p>
      </div>
      <div className="map-container">
        <Map />
      </div>
    </div>
  );
}

export default AboutUs;
